import { createRouter, createWebHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import bloodBankHome from '../views/bloodBankHome'
import chatBotAI from '../views/chatBotAI'
import searchBlood from '../views/searchBlood'
import bloodRequest from '../views/bloodRequest'

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView,
      children:[{
        path: '/blood-bank-home',
        name: 'bloodBankHome',
        component: bloodBankHome
    },{
      path: '/search-blood',
      name: 'searchBlood',
      component: searchBlood,
      children:[{
        path: '/search-blood/blood-request',
        name: 'bloodRequest',
        component: bloodRequest
      }
      ]
    }
      ]
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  },
  {
    path: '/chatbot',
    name: 'chatBotAI',
    component: chatBotAI
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
